import React from 'react'



const Product = ({id,title,description,price,category,image}) =>{
    //console.log(props);

    return(
        <div key={id}>
            <h2>{title}</h2>
          <img src={image} />
          <h3>Belongs under the {category} - ${price}</h3>
          <h4>{description}</h4>
        </div>
    )
}

export default Product
